import React from "react";

const UsersItem = (props) => {
    return (
        <div>
            {props.name}
            <br/>
        </div>
    );
}

const Users = (props) => {
    return <div>{
        props.users.map(u => {
            console.log(u);
            return (
                <div>
                    {u.name}
                    <br/>
                    <button onClick={() => {
                        props.unfollow(u.id)
                    }}> follow </button>
                </div>)
        })
    };
    </div>
}

export default Users;
